import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Grid } from "arclight-react";
import Card from "../Card/Card";

const _Grid = styled.div`
  margin: 25px;
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <_Grid>
          <table width={"100%"}>
            <tbody>
              <tr>
                <td>
                  <Grid
                    theme={"Dark"}
                    itemsPerRow={5}
                    items={[<Card />, <Card />, <Card />, <Card />, <Card />]}
                  />
                </td>
                <td width={"15%"} />
                <td>
                  <Grid
                    theme={"Dark"}
                    itemsPerRow={5}
                    items={[<Card />, <Card />, <Card />, <Card />, <Card />]}
                  />
                </td>
              </tr>
            </tbody>
          </table>
        </_Grid>
      </ThemeProvider>
    );
  }
}
